        "autoGrantPermissions": true,
        // "autoDismissAlerts": true
        // "browser": "safari"

    }],
    mochaOpts:{
        ui: 'bdd',
        require: ['@babel/register'],
        timeout: 600000
    },
    waitForTimeOut : 5000,
    before: function (){
        global.chaiExpect = chai.expect

